/*Table structure for table `job_jmqconfig` */

DROP TABLE IF EXISTS `job_jmqconfig`;

CREATE TABLE `job_jmqconfig` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `jmqApp` varchar(100) NOT NULL COMMENT 'jmq的app',
  `jmqPass` varchar(100) NOT NULL,
  `jmqAddress` varchar(200) NOT NULL COMMENT 'jmq地址',
  `systemCode` varchar(100) DEFAULT NULL COMMENT '平台系统编码',
  `systemName` varchar(100) DEFAULT NULL COMMENT '平台系统名字',
  `mqType` varchar(10) DEFAULT NULL COMMENT 'jmq、fmq',
  `sysApp` varchar(10) DEFAULT NULL,
  `sysAppName` varchar(255) DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1' COMMENT '1有效0无效',
  `createDate` datetime DEFAULT NULL,
  `updateDate` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `jmqApp` (`jmqApp`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

/*Data for the table `job_jmqconfig` */

/*Table structure for table `job_jsfconfig` */

DROP TABLE IF EXISTS `job_jsfconfig`;

CREATE TABLE `job_jsfconfig` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `interfaceId` varchar(100) NOT NULL COMMENT '接口全拼',
  `alias` varchar(100) NOT NULL COMMENT '别名',
  `protocol` varchar(100) DEFAULT NULL COMMENT '协议。默认为jsf',
  `async` tinyint(10) DEFAULT NULL COMMENT '是否异步',
  `sysApp` varchar(255) DEFAULT NULL COMMENT '任务系统(作为平台，后续会接入很多系统)',
  `sysAppName` varchar(255) DEFAULT NULL,
  `createDate` datetime DEFAULT NULL,
  `updateDate` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `jmqApp` (`interfaceId`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `job_jsfconfig` */

/*Table structure for table `job_serverinstanceinfo` */

DROP TABLE IF EXISTS `job_serverinstanceinfo`;

CREATE TABLE `job_serverinstanceinfo` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `serverIp` varchar(50) NOT NULL COMMENT '服务实例IP',
  `serverPath` varchar(200) NOT NULL COMMENT '服务实例路径',
  `uuid` varchar(250) NOT NULL COMMENT 'UUID',
  `lastUpdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_uuid` (`uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='服务器实例信息';

