/*Table structure for table `job_taskserviceconfig` */

DROP TABLE IF EXISTS `job_taskserviceconfig`;

CREATE TABLE `job_taskserviceconfig` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `taskType` int(11) NOT NULL COMMENT '任务类型',
  `taskTypeKey` varchar(100) NOT NULL COMMENT '任务类型key',
  `taskTypeDesc` varchar(100) DEFAULT NULL COMMENT '任务类型描述',
  `taskService` varchar(100) DEFAULT NULL COMMENT 'serviceId',
  `taskParentType` int(11) DEFAULT NULL COMMENT '父任务类型',
  `taskParentTypeDesc` varchar(100) DEFAULT NULL COMMENT '父任务类型描述',
  `status` int(11) DEFAULT NULL,
  `createtime` datetime DEFAULT NULL,
  `lastupdatetime` datetime DEFAULT NULL COMMENT '任务状态。0停止，1启动',
  `taskTotalSize` int(11) NOT NULL COMMENT '从task表里拉取的数据量',
  `taskSizePerThread` int(11) NOT NULL COMMENT '线程池单个核心线程处理的task量。线程池核心线程数量=taskSizePerThread/taskTotalSize',
  `lockType` int(11) NOT NULL COMMENT '0:任务线程将数据逐条加上乐观锁,1:任务线程将数据批量锁',
  `repeatInterval` int(11) NOT NULL COMMENT '单位秒。执行频率。每多长时间执行一次',
  `jmqApp` varchar(20) DEFAULT NULL COMMENT 'mq、jmq、jsf、http',
  `jmqTopic` varchar(100) DEFAULT NULL COMMENT 'jmq应用名',
  `jsfConfigJson` varchar(100) DEFAULT NULL COMMENT 'topic',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uq_taskType` (`taskType`) USING BTREE,
  UNIQUE KEY `uq_taskTypeKey` (`taskTypeKey`),
  UNIQUE KEY `uq_taskParentType` (`taskParentType`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='任务参数配置';

