  `taskType` int(20) NOT NULL COMMENT '任务类型',
  `corePoolSize` int(20) NOT NULL COMMENT '核心线程数量',
  `maxPoolSize` int(20) NOT NULL COMMENT '最大线程数量',
  `keepAliveSeconds` int(20) NOT NULL COMMENT '线程空闲时间',
  `allowCoreThreadTimeOut` tinyint(4) NOT NULL COMMENT '核心线程空闲退出',
  `queueCapacity` int(20) NOT NULL COMMENT '任务队列容量',
  `lastUpdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `index_taskType` (`taskType`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='任务线程池配置';

